// src/App.js
import React from 'react';
import './App.css';
import SensorData from './SensorData';

function App() {
  return (
    <div className="App">
      <SensorData type="temperature" sensorId="sensor1" />
      <SensorData type="humidity" sensorId="sensor2" />
    </div>
  );
}

export default App;
